import React, { useContext } from 'react';
import SearchableUsersContext from '../../contexts/searchableUsers/searchableUsersContext';
import SearchItem from './SearchItem';

const SearchResults = () => {
  const searchableUsersContext = useContext(SearchableUsersContext);
  const { searchableUsers, filteredUsers } = searchableUsersContext;

  console.log(searchableUsers.length)
  return (
    <li>
      {searchableUsers.length === 0 ? (
        <span>Loading...</span>
      ) : (
        <React.Fragment>
          {filteredUsers.length !== 0 ? (
            filteredUsers.map(user => 
              <SearchItem key={user._id} user={user}/>
            )
          ) : (
            searchableUsers.map(user =>
              <SearchItem key={user._id} user={user}/>
            )
          )}
        </React.Fragment>
      )}
    </li>
  );
}

export default SearchResults;
